    /**
     * 写入到 03 excel 文件
     */
    @Test
    public void excelWriter03Test() {
        // 待生成的 excel 文件路径
        final String filePath = "excelWriter031.xls";

        // 对象列表
        List<ExcelFieldModel> models = buildModelList();

        IExcelWriter excelWriter = null;
        OutputStream outputStream = null;
        try {
            excelWriter = ExcelUtil.get03ExcelWriter();
            outputStream = new FileOutputStream(filePath);
            // 可根据实际需要，多次写入列表
            IExcelWriter write = excelWriter.write(models);

            // 将列表内容真正的输出到 excel 文件
            excelWriter.flush(outputStream);
        } catch (IOException e) {
            throw new ExcelRuntimeException(e);
        } finally {
            try {
                excelWriter.close();
            } catch (IOException e) {
                e.printStackTrace();
            }
            try {
                outputStream.close();
            } catch (IOException e) {
                e.printStackTrace();
            }
        }
    }

